import React from "react";
import { FaChalkboard } from "react-icons/fa";

const Dashboard = () => {
  return (
    <div>
      <div className="m-2 box-border border-4 bg-green-300 rounded-xl">
        <div className="flex">
          <h1 className="text-3xl my-1 text-gray-400 p-2">
            <FcDoughnutChart />
          </h1>
          <h1 className=" text-gray-700 text-xl md:text-2xl p-2">Dashboard:</h1>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
